% Simple System File
% First attempt at modeling system

%%
% Create system
% distance, velocity, acceleration, input is throttle, measure distance
% x = [d v a]^T

b = 0.8;  % linear damping (aka decay rate of velocity)   -1/s
T = 0.1;  % throttle time constant     - s
K = 3;    % acceleration per throttle (aka max acceleration) in m/s/%

A = [0 1 0; 0 -b 1; 0 0 -1/T] %[output:9cd458b6]
B = [0; 0; K/T] %[output:6cb6927d]
C = [1 0 0] %[output:5a614817]





% Look at stability, contrlblty, obsrvblty
eig(A) % => only position mode is marginally stable, accel and velocity are stable %[output:460425b8]

P = [B A*B A^2*B];
rank(P) % => controllable %[output:10ae88ee]

Q = [C; C*A; C*A^2];
rank(Q) % => observable %[output:286c5c17]





% Solve the system
syms t tau
x0 = [0; 0; 0];

u = piecewise(t<=2,  1, ... %[output:group:4ee7f181] %[output:012a011f]
              t>2, 0) %[output:group:4ee7f181] %[output:012a011f]


x = expm(A*t)*x0 + int(expm(A*(t-tau))*B*subs(u,t,tau),tau,[0 t]);




% Plotting
t0 = 0;
tf = 10;

figure %[output:50721bf3]
hold on %[output:50721bf3]
fplot(x(1),[t0 tf]) %[output:50721bf3]
title("Distance over Time") %[output:50721bf3]
xlabel("t") %[output:50721bf3]
ylabel("d") %[output:50721bf3]
grid on %[output:50721bf3]

figure %[output:6da3928b]
hold on %[output:6da3928b]
fplot(x(2),[t0 tf]) %[output:6da3928b]
title("Velocity over Time") %[output:6da3928b]
xlabel("t") %[output:6da3928b]
ylabel("v") %[output:6da3928b]
grid on %[output:6da3928b]

figure %[output:95dce7f2]
hold on %[output:95dce7f2]
fplot(x(3),[t0 tf]) %[output:95dce7f2]
title("Acceleration over Time") %[output:95dce7f2]
xlabel("t") %[output:95dce7f2]
ylabel("a") %[output:95dce7f2]
grid on %[output:95dce7f2]
%%
% Implement a feedforward controller for constant reference position

K = place(A,B,[-0.5,-2,-8]) %[output:03d64e00]
kg = -inv(C*inv(A-B*K)*B) %[output:4b91d9d6]


Acl = A-B*K %[output:815bfcf6]
Bcl = B*kg %[output:707db34e]

r = 10 %[output:15580f53]
x = expm(Acl*t)*x0 + int(expm(Acl*(t-tau))*Bcl*subs(r,t,tau),tau,[0 t]);




% Plotting
t0 = 0;
tf = 20;

figure %[output:895488c9]
hold on %[output:895488c9]
fplot(x(1),[t0 tf]) %[output:895488c9]
fplot(r,[t0 tf]) %[output:895488c9]
title("Distance over Time") %[output:895488c9]
legend("Vehicle", "Reference") %[output:895488c9]
xlabel("t") %[output:895488c9]
ylabel("d") %[output:895488c9]
grid on %[output:895488c9]

figure %[output:3531e245]
hold on %[output:3531e245]
fplot(x(2),[t0 tf]) %[output:3531e245]
title("Velocity over Time") %[output:3531e245]
xlabel("t") %[output:3531e245]
ylabel("v") %[output:3531e245]
grid on %[output:3531e245]

figure %[output:909812ea]
hold on %[output:909812ea]
fplot(x(3),[t0 tf]) %[output:909812ea]
title("Acceleration over Time") %[output:909812ea]
xlabel("t") %[output:909812ea]
ylabel("a") %[output:909812ea]
grid on %[output:909812ea]
%%
% Implement an integral controller for constant reference position

A1 = [A zeros(3,1); -C zeros(1,1)];
B1 = [B; 0];
K1 = place(A1,B1,[-0.5,-2,-8,-3]) %[output:7e52343f]

P = ctrb(A1,B1);
rank(P) %[output:5b92302f]

Acl = A1-B1*K1 %[output:1f07b38f]
Bcl = [zeros(3,1); 1];
Ccl = eye(4);
Dcl = 0;

eig(Acl) %[output:06ce3664]

x01 = [x0; 0];

t0 = 0;
tf = 20;

r = 10 %[output:7cd5e8f1]
tvals = linspace(t0,tf,1000);
rvals = ones(size(tvals))*r %tvals; %[output:83a1fcf7]

sys = ss(Acl, Bcl, Ccl, Dcl);
yvals = lsim(sys,rvals,tvals,x01);




% Plotting


figure %[output:4d1086c1]
hold on %[output:4d1086c1]
plot(tvals,yvals(:,1)) %[output:4d1086c1]
plot(tvals,rvals) %[output:4d1086c1]
title("Distance over Time") %[output:4d1086c1]
legend("Vehicle", "Reference") %[output:4d1086c1]
xlabel("t") %[output:4d1086c1]
ylabel("d") %[output:4d1086c1]
grid on %[output:4d1086c1]

figure %[output:36e71af2]
hold on %[output:36e71af2]
plot(tvals,yvals(:,2)) %[output:36e71af2]
title("Velocity over Time") %[output:36e71af2]
xlabel("t") %[output:36e71af2]
ylabel("v") %[output:36e71af2]
grid on %[output:36e71af2]

