%%
% Implement state feedback with ramp position state reference 

K = place(A,B,[-0.5,-2,-8]) %[output:6fea030f]
% kg = -inv(C*inv(A-B*K)*B)

t0 = 0;
tf = 20;
dt = 0.1;
tvals = t0:dt:tf;

xref = [tvals; ones(size(tvals)); zeros(size(tvals))];

x = zeros(3,length(tvals));
x(:,1) = x0;

for i = 1:length(tvals)-1
    e = x(:,i) - xref(:,i);

    u = -K*e;

    xdot = A*x(:,i)+B*u;
    x(:,i+1) = x(:,i) + xdot*dt;
end









% Plotting

figure %[output:26c10fc7]
hold on %[output:26c10fc7]
plot(tvals,x(1,:)) %[output:26c10fc7]
plot(tvals,xref(1,:)) %[output:26c10fc7]
