%%
% Implement state feedback with ramp position state reference and integral

A1 = [A zeros(3,1); -C zeros(1,1)];
B1 = [B; 0];
K1 = place(A1,B1,[-0.5,-2,-8,-3]) %[output:1fbbd0ff]
Br = [0;0;0;1] %[output:5d0b5c80]
M = [1 0 0 0] %[output:58775c25]

% kg = -inv(C*inv(A-B*K)*B)

t0 = 0;
tf = 20;
dt = 0.1;
tvals = t0:dt:tf;

xref = [tvals+0.5*cos(tvals); 1-0.5*sin(tvals); zeros(size(tvals)); zeros(size(tvals))];

x = zeros(4,length(tvals));
x(:,1) = [x0; 0];

for i = 1:length(tvals)-1
    e = x(1:3,i) - xref(1:3,i);

    u = -K1(1:3)*e-K1(4)*x(4,i);

    u = max(u,-1);
    u = min(u,1);

    xdot = A1*x(:,i)+B1*u + Br*M*xref(:,i);
    x(:,i+1) = x(:,i) + xdot*dt;
end









% Plotting

figure %[output:47ba7c8d]
hold on %[output:47ba7c8d]
plot(tvals,x(1,:)) %[output:47ba7c8d]
plot(tvals,xref(1,:)) %[output:47ba7c8d]
title("Distance over Time") %[output:47ba7c8d]
legend("Vehicle", "Reference") %[output:47ba7c8d]
xlabel("t") %[output:47ba7c8d]
ylabel("d") %[output:47ba7c8d]
